    $(function () {
        $(document).tooltip({
            items: "img, [data-pic], [title]",
            position: { my: "left+15 center", at: "right center" },
            content: function () {
                var element = $(this);
                if (element.is("[data-pic]")) {
                    var image = element.attr("data-pic");
                    var clss = element.attr("data-class");
                    return "<img class='" + clss + "' alt='" + image + "' src='../Images/" + image + "'>";
                }
                if (element.is("[title]")) {
                    return element.attr("title");
                }
                if (element.is("img")) {
                    return element.attr("alt");
                }
            }
        });
    });

    $(".calculate").click(function () {
        var batchVolume = parseFloat($('.batchVolume').val());
        var grainBill = parseFloat($('.grainBill').val());
        var boilTime = parseFloat($('.boilTime').val());
        var trubLoss = parseFloat($('.trubLoss').val());
        var mashTunLoss = parseFloat($('.mashTunLoss').val());
        var mashThickness = parseFloat($('.mashThickness').val());
        var grainsTemp = parseFloat($('.grainsTemp').val());
        var targetMashTemp = parseFloat($('.targetMashTemp').val());
        var shrinkPerct = parseFloat($('.shrinkPerct').val());
        var grainAbsRate = parseFloat($('.grainAbsRate').val());
        var evapPerct = parseFloat($('.evapPerct').val());

        //The Calculations...
        var evapFactor = 1 - (evapPerct * (boilTime / 60));
        var shrinkFactor = 1 - shrinkPerct;
        var preBoiledWort = ((batchVolume + trubLoss) / shrinkFactor) / evapFactor;
        var totalWater = preBoiledWort + mashTunLoss + (grainBill * grainAbsRate);
        var mashWater = (mashThickness * grainBill) / 4;
        var spargeWater = totalWater - mashWater;

        //Calculate the Strike Water Temp°
        var strikeWaterTemp = (.2 / mashThickness) * (targetMashTemp - grainsTemp) + targetMashTemp;

        $('.totalWater').html(totalWater.toFixed(2) + ' ' + '<span class="msSubScript">gallons</span>');
        $('.mashWater').html(mashWater.toFixed(2) + ' ' + '<span class="msSubScript">gallons</span> <span class="strikeWaterTemp">@' + strikeWaterTemp.toFixed(2) + '°F</span>');
        $('.spargeWater').html(spargeWater.toFixed(2) + ' ' + '<span class="msSubScript">gallons</span>');
        $('.preBoiledWort').html(preBoiledWort.toFixed(2) + ' ' + '<span class="msSubScript">gallons</span>');
        $('.msResults').show();

    });

    $(".plusminus").click(function () {
        var control = $(this).attr("data-control-class");
        var plusOrMinus = $(this).html();
        var amountBy = parseFloat($(this).attr("data-amountby"));
        var amount = parseFloat($("." + control).val());
        var changeAmount = 0;
        if (plusOrMinus == "▲") {
            changeAmount = amount + amountBy;
        } else {
            changeAmount = amount - amountBy;
            if (changeAmount < 0) {
                changeAmount = 0;
            }
        }
        if (changeAmount.toString().indexOf(".") > -1) {
            changeAmount = changeAmount.toFixed(2);
        }
        $("." + control).val(changeAmount);
        return false;
    });

